import React, { useState } from "react";
import "../../styles/flowTwo/StepOne2.css";
import Header from "../UserFlowOne/Header";
import Footer from "../UserFlowTwo/Footer";
import { vehicleMakes } from "../../constants/vehicleMakes";
import { vehicleModel } from "../../constants/vehicleModel";
import { vehicleType } from "../../constants/vehicleType";

const StepOne2 = ({ nextStep }) => {
  const [vehicles, setVehicles] = useState([
    {
      year: "",
      make: "",
      model: "",
      type: "",
      ownership: "Owned (not making loan payments)",
      mileage: "10,000 miles",
      primaryUse: "Commute to Work",
    },
  ]);

  const [errors, setErrors] = useState([]);

  const handleVehicleChange = (index, e) => {
    const { name, value } = e.target;
    setVehicles((prevVehicles) =>
      prevVehicles.map((vehicle, i) =>
        i === index ? { ...vehicle, [name]: value } : vehicle
      )
    );
  };

  const addAnotherVehicle = () => {
    setVehicles([
      ...vehicles,
      {
        year: "",
        make: "",
        model: "",
        type: "",
        ownership: "Owned (not making loan payments)",
        mileage: "10,000 miles",
        primaryUse: "Commute to Work",
      },
    ]);
  };

  const validateVehicle = (vehicle) => {
    const errors = {};
    if (!vehicle.year) errors.year = "Year is required";
    if (!vehicle.make) errors.make = "Make is required";
    if (!vehicle.model) errors.model = "Model is required";
    if (!vehicle.type) errors.type = "Type is required";
    return errors;
  };

  const handleSubmit = () => {
    const validationErrors = vehicles.map(validateVehicle);
    setErrors(validationErrors);

    const isValid = validationErrors.every(
      (error) => Object.keys(error).length === 0
    );
    if (isValid) {
      nextStep(vehicles);
    }
  };

  return (
    <div>
      <Header />
      <div className="vehicle-details-container">
        <h2>Get the Best Rates in Your Area!</h2>
        <p>
          Get your quote in just 3 simple steps. Enter your information below.
        </p>

        {vehicles.map((vehicle, index) => (
          <div key={index} className="form-section">
            <div className="section-header">
              <span className="section-number">{index + 1}</span>
              <h3>About Your Vehicle {index + 1}</h3>
            </div>

            <label htmlFor={`year-${index}`}>
              Vehicle Year{" "}
              {errors[index]?.year && (
                <span className="error-message">{errors[index].year}</span>
              )}
            </label>
            <select
              id={`year-${index}`}
              name="year"
              value={vehicle.year}
              onChange={(e) => handleVehicleChange(index, e)}
              className={errors[index]?.year ? "error-field" : ""}
            >
              <option value="">Please Select</option>
              {Array.from(
                new Array(71),
                (_, i) => new Date().getFullYear() - i
              ).map((year) => (
                <option key={year} value={year}>
                  {year}
                </option>
              ))}
            </select>

            <label htmlFor={`make-${index}`}>
              Vehicle Make{" "}
              {errors[index]?.make && (
                <span className="error-message">{errors[index].make}</span>
              )}
            </label>
            <select
              id={`make-${index}`}
              name="make"
              value={vehicle.make}
              onChange={(e) => handleVehicleChange(index, e)}
              className={errors[index]?.make ? "error-field" : ""}
            >
              <option value="">Please Select</option>
              {vehicleMakes.map((make) => (
                <option key={make} value={make}>
                  {make}
                </option>
              ))}
            </select>

            <label htmlFor={`model-${index}`}>
              Vehicle Model{" "}
              {errors[index]?.model && (
                <span className="error-message">{errors[index].model}</span>
              )}
            </label>
            <select
              id={`model-${index}`}
              name="model"
              value={vehicle.model}
              onChange={(e) => handleVehicleChange(index, e)}
              disabled={!vehicle.make}
              className={errors[index]?.model ? "error-field" : ""}
            >
              <option value="">Please Select</option>
              {(vehicleModel[vehicle.make] || []).map((model) => (
                <option key={model} value={model}>
                  {model}
                </option>
              ))}
            </select>

            <label htmlFor={`type-${index}`}>
              Vehicle Type{" "}
              {errors[index]?.type && (
                <span className="error-message">{errors[index].type}</span>
              )}
            </label>
            <select
              id={`type-${index}`}
              name="type"
              value={vehicle.type}
              onChange={(e) => handleVehicleChange(index, e)}
              disabled={!vehicle.model}
              className={errors[index]?.type ? "error-field" : ""}
            >
              <option value="">Please Select</option>
              {(vehicleType[vehicle.model] || []).map((type) => (
                <option key={type} value={type}>
                  {type}
                </option>
              ))}
            </select>
          </div>
        ))}

        <button className="add-vehicle-button" onClick={addAnotherVehicle}>
          + Add Another Vehicle (Optional)
        </button>
        <button className="next-step-button" onClick={handleSubmit}>
          Next Step
        </button>
      </div>
      <Footer />
    </div>
  );
};

export default StepOne2;
